module.exports = "<!--The content below is only a placeholder and can be replaced.-->\n\n\n<div class=\"teste d-none d-md-block\">\n \n<a href=\"#bio\"> <img src=\"../assets/bio.png\"> </a>\n\n</div>\n\n<div class=\"teste2 d-none d-md-block\">\n  \n    <a href=\"#interesses\"> <img src=\"../assets/interesses.png\"> </a>\n  \n  </div>\n\n  <div class=\"teste3 d-none d-md-block\">\n    \n      <a href=\"#profissional\"> <img src=\"../assets/profissional.png\"> </a>    \n    </div>\n\n      <div class=\"teste4 d-none d-md-block\">\n  \n          <a href=\"#academico\"> <img src=\"../assets/academico.png\"> </a>\n            \n            </div>\n\n\n<section id=\"topo\">\n  <br>\n<div style=\"text-align:center\">\n  <div >\n    <img width=\"40%\" src=\"../assets/fundo-perfil.png\">   \n  </div>\n<br>\n  <h1 style=\"color: #5a5a5a\">\n    Marcos Muniz\n  </h1>\n</div>\n</section>\n\n<section id=\"menu\" class=\"bg-amarelo\">\n\n    <br>\n    <div class=\"container\">\n      <div class=\"row\">\n        <div class=\"col-sm\">\n            \n          <fa-icon [icon]=\"faUser\"></fa-icon> Marcos Vinícius Muniz <br>\n          <fa-icon [icon]=\"faBaby\"></fa-icon> 13/09/1997 <br>\n          <fa-icon [icon]=\"faMale\"></fa-icon> Masculino <br>\n              \n        </div>\n        <div class=\"col-sm\">\n            <fa-icon [icon]=\"faEnvelope\"></fa-icon> marcosmuniz101@gmail.com<br>\n            <fa-icon [icon]=\"faMaleta\"></fa-icon> Tecnologo da informação<br>\n            <fa-icon [icon]=\"faCoracao\"></fa-icon> Solteiro <br>\n        </div>\n        <div class=\"col-sm\">\n            <fa-icon [icon]=\"faMapa\"></fa-icon> Brasil > Tocantins > Palmas<br>\n            <fa-icon [icon]=\"faPhone\"></fa-icon> (63) 99280-8960<br>\n            <fa-icon [icon]=\"faCode\"></fa-icon> <a  href=\"https://github.com/marcosmuniz101\"> <font color=\"black\"> marcosmuniz101 </font></a><br>\n        </div>\n      </div>\n    </div>\n    \n<br>\n</section>\n\n<section id=\"bio\">\n<h1 style=\"text-align: center; color: #5a5a5a\" >Biografia</h1>\n\n<p style=\"text-align: center\">\n  Nascido em Palmas, capital com cara de interior do mais novo estado brasileiro, filho de Raimunda Muniz e Idenildes Izidorio e o segundo de\n  três filhos. Inserido em três principais circulos sociais, sendo eles a Faculdade, o Trabalho e a Igreja, sendo uma daquelas pessoas boa em muitas coisas, mas não chega a ser especialista em nada.\n    Para especificar melhor cada circulo vamos por partes:\n</p>\n<p style=\"text-align: center\" class=\"recuo\">\n  Primeiramente, Igreja, Cristão meia-boca descreve bem esse circulo, mas porém, esforçado e bem melhor que ontem. Adventista do Sétimo Dia (sim, aquela que guarda o sabádo), não se considera um religioso cego, logo que questiona um fundamento para aquilo que houve e não vê a biblia separada da historia e da arquelogia. Se fosse para resumir a caminhada cristã de Marcos Muniz, certamente se chegaria a um método  hipotético-dedutivo de Tentativa e Erro.\n\n</p>\n<p style=\"text-align: center\" class=\"recuo\">\n  Emprego. Então, todo mundo precisa de dinheiro e mesmo sendo muito lindo, Marcos ainda não encontrou uma Dona Lurdes para o sustentalo e dar um HB20s, por está causa, trabalha em uma escola particular de Palmas como TI. Não o pergunte o que ele faz lá, porque ele faz tudo, mas tudo no velho e bom instinto do muleque malino. Servidor parou? Reinicia! Impressora parou? reinicia! A internet caiu? Reinicia! O professor disse que o comutador estragou? Vai lá e liga o cabo de força na tomada! \n</p>\n<p style=\"text-align: center\" class=\"recuo\">\n\n  Por último, mas não menos estressante, Faculdade. O lema não poderia ser outro se não \"Continue a nadar, continue a nadar...\", pois no sétimo periodo de Sistemas de Informação a gente aprende a escolher entre dormir na aula ou ter gastrite por tomar café com estómago vazio. Mas sobre tudo, apaixonado de uma forma melancólica pelo curso, menos pelas matérias que envolvem matemática que sempre têm dobradinha.\n\n  \n</p>\n\n</section>\n\n<section id=\"interesses\" class=\"interesses\">\n\n<h1 style=\"text-align: center; color: #ffffff\">Interesses</h1>\n\n<br>\n\n<div class=\"container\">\n    <div class=\"row\">\n\n      <div class=\"col-sm\">\n          <div class=\"card\" style=\"width: 18rem;\">\n              <img src=\"../assets/cards/car1_img2.jpg\" class=\"card-img-top\" alt=\"...\">\n              <div class=\"card-body\">\n                <h5 class=\"card-title\">Fotografia</h5>\n                <p class=\"card-text\">Porque minha memoria é ruim, mas meu olhar é poetico. </p>\n                \n              </div>\n            </div>\n      </div>\n      \n\n      <div class=\"col-sm\">\n          <div class=\"card\" style=\"width: 18rem;\">\n              <img src=\"../assets/cards/img2.jpg\" class=\"card-img-top\" alt=\"...\">\n              <div class=\"card-body\">\n                <h5 class=\"card-title\">Tecnologia</h5>\n                <p class=\"card-text\">Eu queria ter tanto dinheiro quanto curiosidade.</p>\n                \n              </div>\n            </div>\n      </div>\n   \n\n      <div class=\"col-sm\">\n          <div class=\"card\" style=\"width: 18rem;\">\n              <img src=\"../assets/cards/img3.jpg\" class=\"card-img-top\" alt=\"...\">\n              <div class=\"card-body\">\n                <h5 class=\"card-title\">Pessoas</h5>\n                <p class=\"card-text\">Namorada, Família, Amigos... relação de amor e ódio.</p>\n                \n              </div>\n            </div>\n      </div>\n      \n\n     \n\n\n\n\n\n    </div>\n\n\n</div>\n\n</section>\n\n<section id=\"profissional\">\n  <br>\n<h1 style=\"text-align: center; color: #5a5a5a\">Profissional</h1>\n<br>\n<div class=\"accordions\"> \n    \n    <div class=\"accordion-item\">\n        <input type=\"radio\" name=\"accordion\" id=\"accordion-2\" />\n        <label for= \"accordion-2\"><h3 style=\"color: #5a5a5a\">Tecmidia Comunicação Visual</h3></label>\n        <div class=\"accordion-content\">\n        <h5 style=\"text-indent:4em\">Auxiliar de Produção <h6 style=\"color: #5a5a5a\">Abril de 2017 - Dezembro de 2017</h6></h5>\n        <h5 style=\"text-indent:4em\">Gerente de Produção <h6 style=\"color: #5a5a5a\">Janeiro de 2018 - Novembro de 2018</h6></h5>\n        \n        </div>\n    </div> \n    <div class=\"accordion-item\">\n        <input type=\"radio\" name=\"accordion\" id=\"accordion-3\" />\n        <label for= \"accordion-3\"><h3 style=\"color: #5a5a5a\">Escola Adventista de Palmas</h3></label>\n        <div class=\"accordion-content\">\n        <h5 style=\"text-indent:4em\">Tecnologo da Informação <h6 style=\"color: #5a5a5a\">Novembro de 2018 - Até as profecias do Fabgod se cumprirem...</h6></h5>\n       \n        \n        </div>\n    </div> \n</div>\t\n<br>\n</section>\n\n<section id=\"academico\" class=\"bg-academico\">\n    <h1 style=\"text-align: center; color: #ffffff\">Académico</h1>\n    \n    <div class=\"accordions\"> \n    \n        <div class=\"accordion-item\">\n            <input type=\"radio\" name=\"accordion\" id=\"accordion-4\" />\n            <label for= \"accordion-4\"><h3 style=\"color: #ffffff\">Assistente Financeiro</h3></label>\n            <div class=\"accordion-content\">\n            <h5 style=\"text-indent:4em\">SENAI<h6 style=\"color: #ffffff\">2016/2 - 2016/2</h6></h5>\n            \n            </div>\n        </div> \n        <div class=\"accordion-item\">\n            <input type=\"radio\" name=\"accordion\" id=\"accordion-5\" />\n            <label for= \"accordion-5\"><h3 style=\"color: #ffffff\">Sistemas de Informações</h3></label>\n            <div class=\"accordion-content\">\n            <h5 style=\"text-indent:4em\">Centro Unniversitário Luterano de Palmas - CEULP/ULBRA<h6 style=\"color: #ffffff\">2016/1 - Ao infinito e além...</h6></h5>\n            <p style=\"text-indent:5em\"><button type=\"button\" class=\"btn btn-primary\" (click)=\"openModal(template)\">Matérias</button>\n            </p>\n            </div>\n        </div> \n    </div>\t\n    <br><br><br><br>\n  \n  \n  \n  \n \n    <ng-template #template>\n        <div class=\"modal-header\">\n          <h4 class=\"modal-title pull-left\">Materias</h4>\n          <button type=\"button\" class=\"close pull-right\" aria-label=\"Close\" (click)=\"modalRef.hide()\">\n            <span aria-hidden=\"true\">&times;</span>\n          </button>\n        </div>\n        <div class=\"modal-body\">\n          <p *ngFor=\"let item of items\"> </p>\n                      \n          \n\n\n\n\n\n        </div>\n      </ng-template>\n      \n\n</section>\n\n\n\n"

